import { makeAutoObservable } from "mobx";
import {
    booksSearch
} from "../services/index.js";

class Mobx {
    booksData = {}

    constructor() {
        makeAutoObservable(this);
    }

    booksSearch = (data) => {
        this.list = booksSearch(data);
    }
}

const MyMobx = new Mobx();
export default MyMobx;
